message:
/* Origins of the term */The article misquoted the phrase "all that has dark sounds has duende". In the lecture being referrenced, this phrase is actually attributed to the artist Manuel Torre. 

Excerpt from English translation of "Juego y teoria del duende" ("Play and Theory of the Duende"):

"And Manuel Torre, a man who had more culture in his veins than anyone I’ve known, on hearing Falla play his own Nocturno del Generalife spoke this splendid sentence: ‘All that has dark sounds has duen...
